import "./Navbar.scss";

import logo from 'C:\Users\HP\Desktop\setup-files-react-city-tours-project\my-app\logo.png';

export default function Navbar(){
  return(
    <nav classNam = "navbar">
    <img src = {logo} alt = 'city tours logo'/>
    </nav>
  );
}
